/*                                                                  */
/* Jac_SP_Vec - function for sparse multiplication: sparse Jacobian times vector */
/*   Arguments :                                                    */
/*      JVS       - sparse Jacobian of variables                    */
/*      UV        - User vector for variables                       */
/*      JUV       - Jacobian times user vector                      */
/*                                                                  */
/* ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ */

void Jac_SP_Vec( 
  double JVS[],                          /* sparse Jacobian of variables */
  double UV[],                           /* User vector for variables */
  double JUV[]                           /* Jacobian times user vector */
)
{
  JUV[0] = JVS[0]*UV[0]+JVS[1]*UV[3]+JVS[2]*UV[7];
  JUV[1] = JVS[3]*UV[1]+JVS[4]*UV[2];
  JUV[2] = JVS[5]*UV[2]+JVS[6]*UV[4]+JVS[7]*UV[8]+JVS[8]*UV[10];
  JUV[3] = JVS[9]*UV[3]+JVS[10]*UV[6]+JVS[11]*UV[7];
  JUV[4] = JVS[12]*UV[4]+JVS[13]*UV[10]+JVS[14]*UV[11];
  JUV[5] = JVS[15]*UV[5]+JVS[16]*UV[6]+JVS[17]*UV[9];
  JUV[6] = JVS[18]*UV[3]+JVS[19]*UV[5]+JVS[20]*UV[6]+JVS[21]*UV[7]
          +JVS[22]*UV[9];
  JUV[7] = JVS[23]*UV[3]+JVS[24]*UV[5]+JVS[25]*UV[6]+JVS[26]*UV[7]
          +JVS[27]*UV[8]+JVS[28]*UV[9]+JVS[29]*UV[10]+JVS[30]*UV[11];
  JUV[8] = JVS[31]*UV[6]+JVS[32]*UV[7]+JVS[33]*UV[8]+JVS[34]*UV[9]
          +JVS[35]*UV[10]+JVS[36]*UV[11];
  JUV[9] = JVS[37]*UV[5]+JVS[38]*UV[6]+JVS[39]*UV[7]+JVS[40]*UV[8]
          +JVS[41]*UV[9]+JVS[43]*UV[11];
  JUV[10] = JVS[44]*UV[4]+JVS[45]*UV[5]+JVS[46]*UV[6]+JVS[48]*UV[8]
           +JVS[49]*UV[9]+JVS[50]*UV[10]+JVS[51]*UV[11];
  JUV[11] = JVS[52]*UV[1]+JVS[53]*UV[2]+JVS[54]*UV[4]+JVS[55]*UV[8]
           +JVS[56]*UV[9]+JVS[57]*UV[10]+JVS[58]*UV[11];
}

